import { Component, OnInit } from '@angular/core';

import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-pagina-inicial',
  templateUrl: './pagina-inicial.component.html',
  styleUrls: ['./pagina-inicial.component.css']
})

export class PaginaInicialComponent implements OnInit{
  title = "Página Inicial";

  result: any;
  urlToJson = 'assets/carteira_acoes.json';

  constructor(public http: HttpClient) {
  }

  ngOnInit(): void {
    this.http.get<any>(this.urlToJson).subscribe(response => {
      this.result = response;
    });
  }
}
<div class="title">
  <h1>Ações</h1>
</div>
<div class="content">
  <table class="table">
    <thead>
      <tr>
        <th scope="col">Ticker</th>
        <th scope="col">Empresa</th>
        <th scope="col">Data</th>
        <th scope="col">Quantidade</th>
        <th scope="col">Preco unitário</th>
        <th scope="col">Total investido</th>
        <th scope="col">Cotação do dia</th>
        <th scope="col">Valorização hoje</th>
        <th scope="col">Valor atual</th>
        <th scope="col">Lucro/Prejuízo</th>
        <th scope="col">%</th>
      </tr>
    </thead>
    <tbody>
      <tr>
        <td colspan="1">{{movie.carteira.ticker}}</td>
        <td colspan="1">{{result.carteira[1].empresa}}</td>
        <td colspan="1">{{result.carteira[1].data}}</td>
        <td colspan="1">{{result.carteira[1].quantidade}}</td>
        <td colspan="1">{{result.carteira[1].preco_unitario}}</td>
        <td colspan="1"></td>
        <td colspan="1"></td>
        <td colspan="1"></td>
        <td colspan="1"></td>
        <td colspan="1"></td>
        <td colspan="1"></td>
      </tr>
    </tbody>
  </table>
</div>
